import React from 'react';
import DeleteForeverIcon from '@material-ui/icons/Delete';
import Button from '@material-ui/core/Button';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
const Note = (props) =>{
    return (
        <>
        <div className="note">
            <h1>{props.title}</h1>
    <p>{props.content}</p>
            <Button className="btn">
                <DeleteForeverIcon/>
            </Button>
        </div>
        </>
    )
}
export default Note;
